window.bookSummaryJSON = "<p><b>A </b><b><i>Wall Street Journal</i></b><b> bestselling series.</b></p> <p><b>To stop a terrorist threat, Gibson Vaughn must trust a man who can’t be trusted.</b></p> <p>Former Marine, brilliant hacker, and wanted fugitive Gibson Vaughn is off the grid in the Caymans. Until the ice-cold assassin Tinsley draws him out of the shadows. Complying with the man who murdered his father and left Gibson for dead? In the war against terror, never say never.</p> <p>Especially when half a million lives are at stake.</p> <p>Tinsley's in possession of a heavily encrypted thumb drive. But the details of the plot - the motive, the targets, and the day of execution - are a mystery. The one certainty is that a tenuous truce must be made. After joining forces with Tinsley, Gibson and his team have their mission: access the drive and abort a massacre in the making.</p> <p>How far can Gibson really trust Tinsley? Time will tell. Right now they’re both running out of it as they race across Europe to find an elusive cyber-psycho behind the mother of all malware.</p> <p>Whoever said to keep your friends close but your enemies closer never meant it like this.</p>"; 
